import React, { Component } from 'react';

class FormTask extends Component {
	render() {
		const { formTask } = this.props;
		return (
			<div>
				<input value={formTask.name} type="text"/>
				<input value={formTask.description} type="text"/>
				<button>123</button>
			</div>
		)
	}
}

export default FormTask;
